import React from 'react';
import App from './App.js';

export default class Parent extends React.Component {
    changeSize(big) {
        big = !big;
        console.log("=========== big: " + big);
        return big;
    }

    render() {
        return (
            <div>
                <App
                    prop1={"This is the App div..."}
                    bignotsmall={big}
                    clickHandler={() => changeSize()} />
            </div>
        );
    };
}
